import React, { Component } from 'react';
import {Container,Row,Col} from 'react-bootstrap';

class Galeria extends Component{

   render(){
     return (
       <div className="Paquetes">
       <Container>
          <Row>
          <Col xs={12} md={12} >
            </Col>
          </Row>
       </Container> </div>
   )
   }
}
export default Galeria;
